import React, { useState, useEffect, useCallback } from 'react';
import api from '../services/api';

// Star rating component
const StarRating = ({ rating, setRating }) => {
    const [hover, setHover] = useState(0);
    return (
        <div className="rating-stars" onMouseLeave={() => setHover(0)}>
            {[...Array(5)].map((_, index) => {
                const ratingValue = index + 1;
                return (
                    <span
                        key={ratingValue}
                        className={ratingValue <= (hover || rating) ? 'star filled' : 'star'}
                        onClick={() => setRating(ratingValue)}
                        onMouseEnter={() => setHover(ratingValue)}
                    >
                        &#9733;
                    </span>
                );
            })}
        </div>
    );
};

export default function Feedback({ recipeId }) {
    const [feedbackList, setFeedbackList] = useState([]);
    const [rating, setRating] = useState(0);
    const [comments, setComments] = useState('');
    const [error, setError] = useState('');

    const fetchFeedback = useCallback(async () => {
        try {
            const res = await api.get(`/recipes/${recipeId}/feedback`);
            setFeedbackList(res.data);
        } catch (err) {
            console.error("Failed to fetch feedback", err);
        }
    }, [recipeId]);

    useEffect(() => {
        fetchFeedback();
    }, [fetchFeedback]);

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (rating === 0) {
            setError('Please select a rating.');
            return;
        }
        setError('');
        try {
            await api.post(`/recipes/${recipeId}/feedback`, {
                Rating: rating,
                Comments: comments
            });
            // Reset form and refresh list
            setRating(0);
            setComments('');
            fetchFeedback();
        } catch (err) {
            setError('Failed to submit feedback.');
        }
    };

    return (
        <div className="feedback-section">
            <h2>Feedback</h2>
            <form className="feedback-form" onSubmit={handleSubmit}>
                <h3>Leave a Review</h3>
                <div className="form-group">
                    <label>Rating</label>
                    <StarRating rating={rating} setRating={setRating} />
                </div>
                <div className="form-group">
                    <label>Comments</label>
                    <textarea 
                        value={comments} 
                        onChange={(e) => setComments(e.target.value)}
                        placeholder="What did you think?"
                    />
                </div>
                {error && <p className="error-message">{error}</p>}
                <button type="submit" className="form-button" style={{width: 'auto'}}>Submit Review</button>
            </form>

            <h3>All Reviews</h3>
            {feedbackList.length === 0 ? (
                <p>No feedback yet.</p>
            ) : (
                <ul className="feedback-list">
                    {feedbackList.map(fb => (
                        <li key={fb.Feedback_ID} className="feedback-item">
                            <div className="feedback-item-header">
                                <strong>{fb.User_Name}</strong>
                                <span className="stars">
                                    {'★'.repeat(fb.Rating)}
                                    {'☆'.repeat(5 - fb.Rating)}
                                </span>
                            </div>
                            <p style={{margin: 0}}>{fb.Comments}</p>
                            <small style={{color: '#6b7280'}}>{new Date(fb.Date).toLocaleDateString()}</small>
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
}
